import { jsPDF } from "jspdf"
import 'jspdf-autotable'
import $ from 'jquery'

let tableVisibility = false
$("#tableVisibility").change( () => { $("#table2").toggleClass('d-none'); tableVisibility = true})

$( "#print" ).click(() => {
    let selectors = {}

    let mainSelectors = $("form").children().children("input"),
        table1 = $( ".table1" ).children().children("input"),
        table2 = $( ".table2" ).children().children("input")

    let sectizer = sel => {
        sel.map((sel, val) => {
            let selector = $(`#${val.id}`)
           selectors[val.id] = {
                value: selector.val(),
                size: selector.attr('maxlength')
            }

        })
    }
    ;[mainSelectors, table1, table2].forEach((el) => sectizer(el))
    let {address, fio, dueDate, perc1, perc2, prepayment, tel,
        model1, height1, width1, nOtdelka1, nColor1, vOtdelka1, vColor1, furniture1, other1, price1, kol1,
        model2, height2, width2, nOtdelka2, nColor2, vOtdelka2, vColor2, furniture2, other2, price2, kol2} = selectors

    let loops1 = $("#loops1").val()
    let loops2 = $("#loops2").val()

    let today = new Date();
    let dd = String(today.getDate()).padStart(2, '0');
    let mm = String(today.getMonth() + 1).padStart(2, '0'); //January is 0!
    let yyyy = today.getFullYear();

    today = `${dd}/${mm}/${yyyy}`
    let modAddress = address.value.length < address.size ? address.value + ' '.repeat(address.size - address.value.length) : address.value
    let pageWidth = 8.5, //8.5
        lineHeight = 1.2,
        margin = 0.35, //0.5
        maxLineWidth = pageWidth - margin * 2,
        fontSize = 8,
        ptsPerInch = 72,
        oneLineHeight = (fontSize * lineHeight) / ptsPerInch,
        text1 =
            `                                                                                                                                                                                      ${today} г.\n  `,
        text2 =
            "ИП Лямин Т.А. ОГРН 314619410600010 , адрес г. Ростов-на-Дону, ул. Стачки 171,тел. (863) 311-12-23, именуемый в\n" +
            `дальнейшем «Продавец» с одной стороны и гр. ${fio.value}\n` +
            `Адрес г. Ростов-на-Дону ${modAddress}\n` +
            "Именуемый (ая) в дальнейшем «Покупатель» заключили настоящий договор (в дальнейшем «Договор») о\n" +
            "нижеследующем:\n" +
            "      1.   ПРЕДМЕТ ДОГОВОРА\n" +
            "      1.1 Продавец передает в собственность покупателю входную стальную дверь (далее товар), а покупатель его\n" +
            "      оплачивает и принимает.\n" +
            "      1.2 Вид товара ассортимент и цена согласуется сторонами при заключении Договора.\n" +
            "      1.3 Качество товара соответствует стандартам, гарантийный срок на товар устанавливается согласно паспорту\n" +
            "      изделия, (выдается при передачи товара Покупателю).\n" +
            "      1.4 Покупателю разъяснены и понятны потребительские свойства и правила эксплуатации (хранения) двери, а\n" +
            "      также, что продаваемая дверь изготавливается по заказу Продавца у производителя дверей на основании\n" +
            "      индивидуальных требований Покупателя.\n" +
            "      2.   СРОКИ И ПОРЯДОК ИСПОЛНЕНИЯ ОБЯЗАТЕЛЬСТВ\n" +
            `      2.1 Покупатель производит предоплату за товар в размере ${perc1.value}% от общей суммы настоящего Договора.\n` +
            `      Оставшаяся оплата в размере ${perc2.value}% от общей суммы настоящего\n` +
            "      Договора осуществляется Покупателем после поставки товара.\n" +
            "      2.2 Исполнение обязательств Продавцом является передача товара Покупателю.\n" +
            `      2.3 Срок передачи товара Покупателю в течении ${dueDate.value} дней от даты подписания договора.\n` +
            "      2.4 Договор считается исполненным с момента приема товара Покупателем.\n" +
            "      3.   ПРАВА И ОБЯЗАННОСТИ СТОРОН\n" +
            "      3.1 Продавец обязан предоставить Покупателю всю информацию о товаре и правила его эксплуатации.\n" +
            "      3.2 Покупатель обязан обратить внимание на соответствие товара целям, для которого приобретается а также\n" +
            "      соотнести габариты изделия, сторон открывания дверных проемов на месте установки.\n" +
            "      3.3 Оплатить товар согласно п.п. 1.1 Договора и в согласованное время принять товар.\n" +
            "      3.4 При обнаружении недостатков в период гарантийного срока немедленно известить Продавца.\n" +
            "      3.5 После получения рекламаций о недостатках и недочетов в работе изделия в период гарантийного срока\n" +
            "      Продавец обязан устранить недостатки в течении 14 рабочих дней и сообщить сроки проведения работ.\n" +
            "      Покупателю.\n" +
            "      4.   ИЗМЕНЕНИЯ ПРИ РАСТОРЖЕНИИ ДОГОВОРА\n" +
            "      4.1 Изменения или расторжение договора возможно только по взаимному соглашению сторон совершенному в\n" +
            "      письменной форме.\n" +
            "      4.2 Форс мажором считаются акты государственных органов и события не зависящие от воли сторон, а также\n" +
            "      обстоятельства при которых становиться невозможным исполнение сторонами или одной из сторон своих\n" +
            "      обязательств.\n" +
            "      4.3 Изменение, расторжение или отказ от исполнения обязательств по договору освобождает стороны от\n" +
            "      возмещения взаимных убытков.\n" +
            "      5.  Спецификация к договору\n",
        text3 = `Продавец                     ИП Лямин Т.А.                                                 Покупатель                               /                        /`,
        text4 = `                                                                               м.п.`,
        text5 = `                                              С условиями эксплуатации и гарантий двери "Торэкс" ознакомлен(а)                 `,
        text6 = `тел. ${tel.value} `
    let doc = new jsPDF({
        unit: "in",
        lineHeight: lineHeight
    })

    doc.addFont('PTSans.ttf', 'PTSans', 'normal')
    doc.setFontSize(8.8)
    let textLines = doc.setFont('PTSans').splitTextToSize(text1, maxLineWidth);

    doc.text(textLines, margin, margin + 2 * oneLineHeight, {align: 'left'});
    let textWidth = doc.getTextWidth(text1);

    let lineWriter = (lineArray, lineWidth) => {
        doc.setLineWidth(lineWidth)
        lineArray.forEach(val => {
            doc.line(val[0], val[1], val[2], val[3])
        })

    }
    let lines = [[6.3, 0.65, 7, 0.65], [3.10, 1.06, 7, 1.06], [1.8, 1.2, 5.65, 1.2], [5.93, 1.2, 7, 1.2],
        [6.1, 9.73, 7, 9.73], [5, 9.73, 6.05, 9.73], [0.95, 9.73, 1.66, 9.73], [6, 10.05, 7, 10.05]]
    lineWriter(lines, 0.01)

    textLines = doc.setFont("PTSans").splitTextToSize(text3, maxLineWidth);
    doc.text(textLines, margin, margin + 70 * oneLineHeight, {charSpace: 0.004});

    textLines = doc.setFont("PTSans").splitTextToSize(text4, maxLineWidth);
    doc.text(textLines, margin, margin + 71 * oneLineHeight, {charSpace: 0.004});

    textLines = doc.setFont("PTSans").splitTextToSize(text5, maxLineWidth);
    doc.text(textLines, margin, margin + 72.2 * oneLineHeight, {charSpace: 0.004});

    textLines = doc.setFont("PTSans").splitTextToSize(text6, maxLineWidth);
    doc.text(textLines, 5.7, margin + 6.2 * oneLineHeight, {charSpace: 0.004});

    doc.addImage("data:image/jpeg;base64,", "JPEG", margin,  margin + 73.2 * oneLineHeight, 6.75, 1.35);

    textLines = doc.setFont("PTSans").splitTextToSize(text2, maxLineWidth);
    doc.text(textLines, margin, margin + 4 * oneLineHeight, {charSpace: 0.004});
    doc.addFont('PTSans-Bold.ttf', 'PTSans-Bold', 'normal')
    doc.setFontSize(11)
    doc.setFont("PTSans-Bold").text(
        "Договор купли-продажи                                                                                                       Ростов-на-Дону",
        margin,
        0.3
    );
    if (!tableVisibility) {
        model2.value = height2.value = width2.value = nOtdelka2.value = nColor2.value = vOtdelka2.value =
            vColor2.value = furniture2.value = other2.value = '---'
        price2.value = kol2.value = 0
    }

    doc.autoTable({
        theme: 'plain',
        styles: {font: 'PTSans',fontStyle: 'bold', lineColor: 10, lineWidth: 0.001, fontSize: 9},
        margin: { top: margin + 46.3 * oneLineHeight, left: margin, right: lineHeight },
        head: [['№', 'Наименование', 'Кол-во', 'Цена', 'Сумма']],
        body: [
            ['1', `Стальная дверь Торэкс ${model1.value}
высота ${height1.value} ширина  ${width1.value} петли ${loops1}
наружняя отделка ${nOtdelka1.value} рисунок ${nColor1.value}
внутренняя отделка ${vOtdelka1.value} рисунок ${vColor1.value}
фурнитура ${furniture1.value} другое ${other1.value}`, `${kol1.value}`, `${price1.value}`, `${price1.value*kol1.value}`],
            ['2', `Стальная дверь Торэкс ${model2.value}
высота ${height2.value} ширина  ${width2.value} петли ${loops2}
наружняя отделка ${nOtdelka2.value} рисунок ${nColor2.value}
внутренняя отделка ${vOtdelka2.value} рисунок ${vColor2.value}
фурнитура ${furniture2.value} другое ${other2.value}`, `${kol2.value}`, `${price2.value}`, `${price2.value*kol2.value}`],
            ['', '', '', '', ''],
            ['', 'ИТОГО', `${parseInt(kol1.value) + parseInt(kol2.value)}`, '', `${(price1.value*kol1.value) + (price2.value*kol2.value)}`],
            ['', '', '', 'Предоплата', `${prepayment.value}`],
        ],
    })

    doc.setProperties({
        title: fio.value
    })

    doc.output('dataurlnewwindow');
});
